*/
import ImageGallery from 'react-image-gallery';
import "react-image-gallery/styles/css/image-gallery.css";

const images=[
  {
    original: "/img/ArtBg.jpg",
    thumbnail:"../img/ArtBg.jpg"
  },
  {
    original:"../img/fifa.jpeg",
    thumbnail:"../img/fifa.jpeg"
  },
  {
    original:"../img/pubg.jpeg",
    thumbnail:"../img/pubg.jpeg"
  },
  {
    original:"../img/FoodBg.jpg",
    thumbnail:"../img/FoodBg.jpg"
  }
]
export default class Event extends Component {
    render() {
        return (
            <div className="container_event">
                <h1>GAMEX</h1>
              <div className="sliders" style={{marginTop:"100px",marginLeft:"200px"}} >
                <ImageGallery items={images} additionalClass="newapp" />
              </div>  

            </div>
        )
    }
}
